import logo from './logo.svg';
import './App.css';

const dummyData = [
  { title: "Naresh", notes: "i am not good boy", expand: true },
  { title: "Naveen", notes: "i am not good boy", expand: true },
  { title: "Dikson", notes: "i am not good boy", expand: false },
]

class App extends Component {
  render() {
    return (
      <div>
        <div className="d-flex p-3 bg-secondary text-white m-2">  
          <button type="button" className="btn btn-primary btn-sm">Add New Note</button>
        </div>
          <form>



          <div className="form-group">
            <div className= "input-container">
              <input type="text" className="input-field" name="title" placeholder="Note Title"></input>
              <button type="button" className="btn btn-sm input-button">‚ùå</button>
            </div>
            <textarea className="form-control notes" rows="10"></textarea>
          </div>

        </form>
      </div>
    );
  }
}

export default App;
